    async void OnClick(RadzenSplitButtonItem item)
    {
        if (item != null)
        {
            if (int.Parse(item.Value) == 1)
                try
                {
                    await _postService.DeletePost(Post.postId);
                }
                catch (Exception e)
                {
                    Console.WriteLine("Post failed to be deleted! " + e);
                }
        }
        else
        {
            Console.WriteLine($"Clicked");
        }
